pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

import 'openzeppelin-solidity/contracts/math/SafeMath.sol';
import 'openzeppelin-solidity/contracts/token/ERC20/ERC20.sol';
import 'openzeppelin-solidity/contracts/ownership/Ownable.sol';
import './Badges.sol';

contract Airdropper is Ownable {
    using SafeMath for uint256;

    event MultiSended(uint256 total, address tokenAddress);

    // Lets you send ether to contract
    function() external payable {}

    function withdraw(uint256 value) public onlyOwner {
        msg.sender.transfer(value);
    }

    function multiSendToken(
        address token,
        address payable[] memory _contributors,
        uint256[] memory _balances,
        uint256 fuel,
        uint256 low_limit
    ) public payable onlyOwner {
        uint256 totalToken = 0;
        uint256 totalEth = 0;
        ERC20 erc20token = ERC20(token);
        uint8 i = 0;
        for (i; i < _contributors.length; i++) {
            erc20token.transferFrom(msg.sender, _contributors[i], _balances[i]);
            if (_contributors[i].balance < low_limit) {
                _contributors[i].transfer(fuel);
                totalEth += fuel;
            }
            totalToken += _balances[i];
        }
        emit MultiSended(totalToken, token);
        emit MultiSended(totalEth, 0x000000000000000000000000000000000000bEEF);
    }

    function multiSendBadge(
        address badgeToken,
        address token,
        address payable[] memory _contributors,
        uint256[] memory _balances,
        string[] memory _url,
        uint256 fuel,
        uint256 low_limit
    ) public payable onlyOwner {
        uint256 totalToken = 0;
        uint256 totalEth = 0;
        ERC20 erc20token = ERC20(token);
        Badges erc721token = Badges(badgeToken);
        uint8 i = 0;
        for (i; i < _contributors.length; i++) {
            erc20token.transferFrom(msg.sender, _contributors[i], _balances[i]);
            erc721token.mintNextTokenWithTokenURI(_contributors[i], _url[i]);
            if (_contributors[i].balance < low_limit) {
                _contributors[i].transfer(fuel);
                totalEth += fuel;
            }
            totalToken += _balances[i];
        }
        emit MultiSended(totalToken, token);
        emit MultiSended(totalEth, 0x000000000000000000000000000000000000bEEF);
    }
}
